import React from 'react';
import MainStack from '../MainStack/MainStack';
import NavIcon from '../NavIcon/NavIcon';

function Techs () {

    const data = [

        titleIcon = {
            id1: 'HTML',
            id2: 'CSS',
            id3: 'JS',
            id4: 'React',
            id5: 'Git',
            id6: 'Express.js',
            id7: 'mongoDB'
        },

        styles = {
            display: 'flex',
            width: 270,
            height: 60,
            width: 10,
        },

        Techs__elements = {
            display: 'grid',
            gridTemplateColumns: 'repeat(7, 90px)',
            columnGap: 10,
            marginLeft: 'auto',
            marginRight: 'auto',
            marginBottom: 100
        },

        NavTab__buttonText = {
            color: '#000000',
            fontStyle: 'normal',
            display: 'flex',
            minWidth: 96, 
            alignItems: 'center',
            justifyContent: 'center',
            textDecoration: 'none',
            fontWeight: 400,
            fontSize: 14,
            lineHeight: 17,
            letterSpacing: '-0.04em'
        },

        Techs__navTabStyle = {
            display: 'flex',
            justifyContent: 'center',
            width: 96,
            height: 60,
            borderRadius: 10,
            margin: 0,
            backgroundColor: '#E8E8E8',
            border: 'none'
        }
    ]
    /*const titleIcon = {
        id1: 'HTML',
        id2: 'CSS',
        id3: 'JS',
        id4: 'React',
        id5: 'Git',
        id6: 'Express.js',
        id7: 'mongoDB'
    }
    const styles = {
        display: 'flex',
        width: 270,
        height: 60,
        width: 10,
    }

    const Techs__elements = {
        display: 'grid',
        gridTemplateColumns: 'repeat(7, 90px)',
        columnGap: 10,
        marginLeft: 'auto',
        marginRight: 'auto',
        marginBottom: 100
    }

    const NavTab__buttonText ={
        color: '#000000',
        fontStyle: 'normal',
        display: 'flex',
        minWidth: 96, 
        alignItems: 'center',
        justifyContent: 'center',
        textDecoration: 'none',
        fontWeight: 400,
        fontSize: 14,
        lineHeight: 17,
        letterSpacing: '-0.04em'
    }

    const Techs__navTabStyle = {
        display: 'flex',
        justifyContent: 'center',
        width: 96,
        height: 60,
        borderRadius: 10,
        margin: 0,
        backgroundColor: '#E8E8E8',
        border: 'none'
    }*/
    console.log(titleIcon)
    return (
        <div>
            <MainStack stackName = {'Технологии'}>
                <h1 className="Promo__title">7 технологий</h1>
                <p className="Techs__description">На курсе веб-разработки мы освоили технологии, которые применили в дипломном проекте.</p>
                <section style= {Techs__elements}>
                          
                
                {data.map((item, id) => (
                    console.log(titleIcon),
                    <NavIcon 
                        key={id}
                        
                        titleIcon={
                            item.titleIcon.id1,
                            item.titleIcon.id2,
                            item.titleIcon.id3,
                            item.titleIcon.id4,
                            item.titleIcon.id5,
                            item.titleIcon.id6,
                            item.titleIcon.id7
                        }
                        iconStyle={item.styles}
                        NavTabText = {item.NavTab__buttonText}
                        NavTabStyle = {item.Techs__navTabStyle}
                    />
                ))}
                </section>
                
            </MainStack>
            
        </div>
    );
}

export default Techs;
